import React, { Component } from 'react';
import Pokecard from './Pokecard';
import './pokedex.css';

class Pokedex extends Component { 
    render() {
        console.log(this.props.hand);
        return this.props.hand.map((item, index) => {
            console.log(item);
            console.log(index);
            return (
                <div key={index}>
                    {<Pokecard data={item}/>}
                </div>
            )
        })


    }
}

export default Pokedex;
